        (1001, 'I have been using the Dashen Supper app mobile banking app , and overall, I appreciate its features.However,I‚Äôve noticed that when I turn on the developer options on my device, the app stops functioning properly. It would be great if you could look into this issue, as I often need to access developer settings for other applications . Thank you for your attention to this matter!', 5, DATE ''2025-04-21'', 3, 'NEGATIVE', 0.9068745970726012, 'Bugs & Performance, Features & Services'),
        (1002, 'easiness to use with fast response time', 5, DATE ''2025-04-21'', 3, 'NEGATIVE', 0.964725911617279, 'Transactions & Transfers'),
        (1003, 'The new mobile banking application is a major upgrade! It‚Äôs incredibly user-friendly, with a clean and modern design that makes navigation simple and intuitive. I really appreciate how fast it loads and how smooth the overall experience is. All essential services like balance checks, transfers, and bill payments are eas y to find and use. The added security features give me peace of mind, and the app runs reliably without crashes or glitches. It‚Äôs clear a lot of thought went into the user experi', 5, DATE ''2025-04-21'', 3, 'POSITIVE', 0.9992745518684388, 'Transactions & Transfers, UI & Experience, Bugs & Performance, Features & Services'),
        (1004, 'As an Internal Customer, Dashen Bank SuperApp has greatly simplified my online banking experience. It''s easy to use, allowing me to quickly check balances, transfer money and pay Bills. The app''s advanced security features are highly secure, ensuring my data is well protected. The Three click, Chat Banking and IPS features have also given me a smarter experience. In deed Dashen Bank is always steping ahead!', 5, DATE ''2025-04-21'', 3, 'POSITIVE', 0.9990044236183168, 'Transactions & Transfers, UI & Experience, Features & Services'),
        (1005, 'A truly impressive app ‚Äî user-friendly and a game-changer in Ethiopian banking. The Dashen Super App stands out as one of the most innovative and convenient digital banking solutions in Ethiopia‚Äôs financial history. Smooth navigation, seamless features, and a wide range of services all in one place. Well done!', 5, DATE ''2025-04-21'', 3, 'POSITIVE', 0.9998193383216858, 'Features & Services'),
        (1006, 'dashen bank super up has very fast and convenience and also it has contain more things on one app .I am very interesting to use dashen bank super up', 5, DATE ''2025-04-21'', 3, 'POSITIVE', 0.9974090456962584, 'Transactions & Transfers'),
        (1007, 'The Dashen Bank Super App has truly elevated my mobile banking experience. It''s fast, user-friendly, and packed with all the essential features. The interface is clean and intuitive, making navigation easy even for first-time users. I also appreciate the added security features that give me peace of mind while banking on the go. Dashen Bank has done an amazing job with this app‚Äîit‚Äôs reliable, efficient, and always improving. Highly recommended for anyone looking for seamless digital banking!', 5, DATE ''2025-04-21'', 3, 'POSITIVE', 0.9998351335525512, 'Transactions & Transfers, UI & Experience, Features & Services'),
        (1008, 'A fantastic product!! keep the good work.', 5, DATE ''2025-04-21'', 3, 'POSITIVE', 0.9998842477798462, 'General Feedback'),
        (1009, 'I am very impressed with the Dashen super app. It is user-friendly and operates efficiently. The budget and chatbot features are impressive, and all items can be purchased with just three clicks.', 5, DATE ''2025-04-21'', 3, 'POSITIVE', 0.9998030066490172, 'Features & Services'),
        (1010, 'The Dashen Super App offers a quick and user-friendly experience, bringing together a variety of services, like budgeting, payments, airtime recharges, and more, all in one convenient platform. Its sleek design and intuitive navigation ensure effortless transactions. It''s evident that Dashen Bank has carefully crafted the app to make everyday financial activities easier. A great choice for anyone aiming to streamline their digital routines!', 5, DATE ''2025-04-21'', 3, 'POSITIVE', 0.999062716960907, 'Transactions & Transfers, UI & Experience, Features & Services'),
